function main(){if(null!==localStorage.getItem("teams"))for(var a=JSON.parse(localStorage.getItem("teams")),e=document.getElementById("teams"),n=0;n<a.length;n++){var l=a[n];e.innerHTML+=`\n            <div class="team" id="${n}">\n                <h1 class="teamName">\n                    ${l.name}\n                    <i class="fas fa-check" aria-label="Check mark, use icon" onclick="generateCommand(${n})"></i>\n                    <i class="far fa-trash-alt" aria-label="Trash icon" onclick="deleteTeam(${n})"></i>\n                    <i class="fas fa-code-branch" aria-label="Code branch icon" onclick="branch(${n})"></i>\n      \x3c!--TODO              <i class="far fa-copy ${n}share" aria-label="Clipboard icon" onclick="share(${n})" id="${n}share"></i> --\x3e\n                </h1>\n                <div class="animal">\n                    <p class="animalType">${l.animals[0].type}<span class="animalWeapon"> - ${l.animals[0].weapon}</span></p>\n                </div>\n                <div class="animal">\n                    <p class="animalType">${l.animals[1].type}<span class="animalWeapon"> - ${l.animals[1].weapon}</p>\n                </div>\n                <div class="animal">\n                    <p class="animalType">${l.animals[2].type}<span class="animalWeapon"> - ${l.animals[1].weapon}</p>\n                </div>\n            </div>`}}function newTeam(){window.location="newTeam/index.html"}function generateCommand(a){window.location=`generateCommand/index.html?i=${a}`}function deleteTeam(a){var e=JSON.parse(localStorage.getItem("teams"));e.splice(a,1),localStorage.setItem("teams",JSON.stringify(e)),document.getElementById(a).remove()}function branch(a){var e=JSON.parse(localStorage.getItem("teams"))[a];console.log(e),window.location=`newTeam/index.html?teamName=${e.name}&animalZeroType=${e.animals[0].type}&animalZeroWeapon=${e.animals[0].weapon}&animalOneType=${e.animals[1].type}&animalOneWeapon=${e.animals[1].weapon}&animalTwoType=${e.animals[2].type}&animalTwoWeapon=${e.animals[2].weapon}`}function share(a){var e=JSON.parse(localStorage.getItem("teams"))[a];const n=document.createElement("text-area");n.value=`${JSON.stringify(e)}`,document.body.appendChild(n),n.select(),n.setSelectionRange(0,99999),document.execCommand("copy"),document.body.removeChild(n);document.getElementById(`${a}share`);document.getElementById("MyElement").classList.remove("fa-copy"),document.getElementById("MyElement").classList.remove("far"),document.getElementById("MyElement").classList.add("fa-check"),document.getElementById("MyElement").classList.add("fas")}